import logo from './logo.svg';
import {useState,useEffect} from 'react';
import './App.css';
import login from './components/Login'
function App() {

  const handleLogin =(event)=>{
    event.preventDefault()
    let {uid,pass}=document.forms[0]
    console.log("user id",uid.value)
    login({userid: uid.value, password: {pass}})
  }


  return (
    <div className="App">
      Welcome to MeriBasket
      <form onSubmit={handleLogin}>
        <div>
        <label>UserID</label>
        <br></br>
        <input type="text" name="uid" required placeholder='Enter User ID'></input>
        </div>
        <div>
        <label>Password</label>
        <br></br>
        <input type="password" name="pass" required placeholder='Enter password'></input>
        </div>
        <div> 
        <button type="submit">Login</button>
        </div>
      </form>
    </div>
  );
}

export default App;
